    private IEnumerator GenerateRandomObj()
    {
        int randomIndex = Random.Range(0, list.Count);
        ConversionData randomObj = list[randomIndex];
        string sourceFileUrl = randomObj.source_file;
        Debug.Log($"source file: {randomObj.source_file}");
        Debug.Log($"url {sourceFileUrl}");
        UnityWebRequest imageRequest = UnityWebRequestTexture.GetTexture(sourceFileUrl);
        yield return imageRequest.SendWebRequest();

        if (imageRequest.result == UnityWebRequest.Result.Success)
        {
            DownloadHandlerTexture downloadHandlerTexture =
                imageRequest.downloadHandler as DownloadHandlerTexture;
            Texture2D texture = downloadHandlerTexture.texture;
            Sprite sprite = Sprite.Create(
                texture,
                new Rect(0, 0, texture.width, texture.height),
                Vector2.one * 0.5f
            );
            objImporter.TriggerImageGeneratedEvent(sprite);
        }

        string meshUrl = randomObj.output_file;
        UnityWebRequest www = UnityWebRequest.Get(meshUrl);
        yield return www.SendWebRequest();

        if (www.result != UnityWebRequest.Result.Success)
        {
            Debug.LogError("API request failed: " + www.error);
            // OnModelGenerationFinished?.Invoke();
            yield break;
        }

        objImporter.ImportGLB(www.downloadHandler.data, meshUrl, transform.position);
    }
}

